(3,9,'A','[\n    {\n        \"message\": \"The mean depth of compressions is above the recommended range, indicating a need for improvement in compression depth control.\",\n        \"sentiment\": \"Negative\"\n    },\n    {\n        \"message\": \"The mean frequency of compressions is considerably higher than recommended, with high variability, showing a need for better frequency regulation.\",\n        \"sentiment\": \"Negative\"\n    },\n    {\n        \"message\": \"The standard deviation in compression depth is high, indicating inconsistency in compression application.\",\n        \"sentiment\": \"Negative\"\n    },\n    {\n        \"message\": \"Overall performance score is low, suggesting an opportunity for targeted feedback and additional practice.\",\n        \"sentiment\": \"Negative\"\n    }\n]'),
(4,11,'A','[\n    {\n        \"message\": \"The average compression depth of 96.44 mm falls within the recommended range for effective CPR.\",\n        \"sentiment\": \"Positive\"\n    },\n    {\n        \"message\": \"There is high variability in compression depth with a standard deviation of 12.23 mm.\",\n        \"sentiment\": \"Negative\"\n    },\n    {\n        \"message\": \"The mean compression frequency of 91.64 compressions per minute suggests pacing is slightly too fast.\",\n        \"sentiment\": \"Negative\"\n    },\n    {\n        \"message\": \"Low variability in compression frequency indicates consistent pacing with a standard deviation of 12.84 compressions per minute.\",\n        \"sentiment\": \"Positive\"\n    },\n    {\n        \"message\": \"Overall performance score of 32.96 indicates there is significant room for improvement.\",\n        \"sentiment\": \"Negative\"\n    }\n]'),
(5,12,'A','[\n    {\n        \"message\": \"The average compression depth of 37.10 mm is below the recommended range of 50-60 mm for effective CPR.\",\n        \"sentiment\": \"Negative\"\n    },\n    {\n        \"message\": \"The average compression frequency of 92.39 compressions per minute is slightly below the recommended range of 100-120 compressions per minute.\",\n        \"sentiment\": \"Negative\"\n    },\n    {\n        \"message\": \"Consistency in compression depth is lacking with a high standard deviation of 8.83 mm, indicating significant variation in the compression depth.\",\n        \"sentiment\": \"Negative\"\n    },\n    {\n        \"message\": \"The overall performance score of 38.19 suggests there is substantial room for improvement in CPR execution.\",\n        \"sentiment\": \"Negative\"\n    }\n]'),
(6,19,'A','[\n    {\n        \"message\": \"The average compression depth of 24.86 mm is significantly below the ideal range of 50-60 mm.\",\n        \"sentiment\": \"Negative\"\n    },\n    {\n        \"message\": \"The average compression frequency of 80.46 compressions per minute is below the recommended range of 100-120 per minute.\",\n        \"sentiment\": \"Negative\"\n    },\n    {\n        \"message\": \"With no compressions within the ideal depth range, the low depth count dominated at 8 instances.\",\n        \"sentiment\": \"Negative\"\n    },\n    {\n        \"message\": \"The standard deviation for compression frequency is notably high, indicating a lack of consistency.\",\n        \"sentiment\": \"Negative\"\n    },\n    {\n        \"message\": \"The overall performance score of 4.97 reflects the need for substantial improvement in technique and consistency.\",\n        \"sentiment\": \"Negative\"\n    }\n]'),
(7,20,'A','[\n    {\n        \"message\": \"The mean compression depth of 42.05 mm indicates a significant deviation below the ideal range.\",\n        \"sentiment\": \"Negative\"\n    },\n    {\n        \"message\": \"Compression frequency is mostly within the ideal range, with a mean of 113.32 compressions per minute.\",\n        \"sentiment\": \"Positive\"\n    },\n    {\n        \"message\": \"The standard deviation for depth is 7.69, showing some inconsistency in depth performance.\",\n        \"sentiment\": \"Negative\"\n    },\n    {\n        \"message\": \"The overall CPR performance score of 47.49 suggests substantial room for improvement.\",\n        \"sentiment\": \"Negative\"\n    },\n    {\n        \"message\": \"Despite the inconsistency, the high-frequency count shows the ability to maintain a good pace intermittently.\",\n        \"sentiment\": \"Positive\"\n    }\n]'),
(8,21,'A','[\n    {\n        \"message\": \"The average compression depth is ideal, perfectly hitting the upper limit of the recommended range.\",\n        \"sentiment\": \"Positive\"\n    },\n    {\n        \"message\": \"The average compression frequency exceeds the recommended range, indicating a need for better frequency control.\",\n        \"sentiment\": \"Negative\"\n    },\n    {\n        \"message\": \"The standard deviation of depth indicates significant variability, suggesting inconsistency in compression depth.\",\n        \"sentiment\": \"Negative\"\n    },\n    {\n        \"message\": \"The overall performance score is below 50, reflecting a need for improvement in CPR technique.\",\n        \"sentiment\": \"Negative\"\n    },\n    {\n        \"message\": \"There is a substantially higher number of compressions performed above the ideal frequency range.\",\n        \"sentiment\": \"Negative\"\n    }\n]'),
(9,22,'A','[\n    {\n        \"message\": \"The average compression depth of 62.03 mm exceeds the ideal range, indicating a tendency for deeper compressions.\",\n        \"sentiment\": \"Negative\"\n    },\n    {\n        \"message\": \"The average compression frequency of 130.64 compressions per minute is significantly higher than the recommended range.\",\n        \"sentiment\": \"Negative\"\n    },\n    {\n        \"message\": \"There is high variability in compression frequency as indicated by the standard deviation of 35.83.\",\n        \"sentiment\": \"Negative\"\n    },\n    {\n        \"message\": \"Despite the high total count of compressions, the overall performance score of 43.79 suggests a need for improvement in technique.\",\n        \"sentiment\": \"Negative\"\n    },\n    {\n        \"message\": \"The consistency in achieving too deep and too frequent compressions suggests difficulty in maintaining ideal CPR standards.\",\n        \"sentiment\": \"Negative\"\n    }\n]'),
(10,23,'A','[\n    {\n        \"message\": \"The mean compression frequency of 101.33 compressions per minute is well within the ideal range.\",\n        \"sentiment\": \"Positive\"\n    },\n    {\n        \"message\": \"The mean compression depth of 151.9 mm significantly exceeds the ideal range, indicating a need for improvement.\",\n        \"sentiment\": \"Negative\"\n    },\n    {\n        \"message\": \"There is a high standard deviation in compression depth, showing inconsistency in maintaining optimal depth.\",\n        \"sentiment\": \"Negative\"\n    },\n    {\n        \"message\": \"With only 31 cases of low frequency and a high frequency count of 5, frequency control is mostly adequate.\",\n        \"sentiment\": \"Positive\"\n    },\n    {\n        \"message\": \"The overall performance score of 35.28 suggests substantial room for improvement in both depth and consistency.\",\n        \"sentiment\": \"Negative\"\n    }\n]'),
(11,24,'A','[\n    {\n        \"message\": \"The mean compression depth significantly exceeds the ideal range, indicating excessively deep compressions.\",\n        \"sentiment\": \"Negative\"\n    },\n    {\n        \"message\": \"The mean compression frequency is slightly above the recommended rate, showing minor over-performance in speed.\",\n        \"sentiment\": \"Negative\"\n    },\n    {\n        \"message\": \"The high standard deviation values for both depth and frequency suggest inconsistency in performance.\",\n        \"sentiment\": \"Negative\"\n    },\n    {\n        \"message\": \"The overall performance score is notably low at 51.01, reflecting the need for significant improvement.\",\n        \"sentiment\": \"Negative\"\n    },\n    {\n        \"message\": \"There were almost no occurrences of excessively high frequency, which is a positive aspect of frequency control.\",\n        \"sentiment\": \"Positive\"\n    }\n]'),
(12,25,'A','[\n    {\n        \"message\": \"The average compression depth exceeds the recommended range, suggesting a need for reduced force.\",\n        \"sentiment\": \"Negative\"\n    },\n    {\n        \"message\": \"The mean compression frequency is below the ideal range, indicating a slower than optimal rate.\",\n        \"sentiment\": \"Negative\"\n    },\n    {\n        \"message\": \"With a high standard deviation in depth, compression depth consistency needs significant improvement.\",\n        \"sentiment\": \"Negative\"\n    },\n    {\n        \"message\": \"No instances of excessively high compression frequency represent control over compression rate.\",\n        \"sentiment\": \"Positive\"\n    },\n    {\n        \"message\": \"The overall performance score is low, highlighting areas for improvement in both depth and frequency.\",\n        \"sentiment\": \"Negative\"\n    }\n]'),
(13,26,'A','[\n    {\n        \"message\": \"The average compression depth of 59.84 mm is within the ideal range, indicating good performance in this aspect.\",\n        \"sentiment\": \"Positive\"\n    },\n    {\n        \"message\": \"The compression rate of 105.87 compressions per minute is ideal, reflecting proper frequency control during the session.\",\n        \"sentiment\": \"Positive\"\n    },\n    {\n        \"message\": \"The high standard deviation in compression depth of 19.28 mm suggests a lack of depth consistency.\",\n        \"sentiment\": \"Negative\"\n    },\n    {\n        \"message\": \"Overall performance score of 58.27 indicates room for improvement in maintaining consistent quality of CPR.\",\n        \"sentiment\": \"Negative\"\n    }\n]'),
(14,27,'A','[\n    {\n        \"message\": \"The average compression frequency is within the ideal range, indicating good frequency control.\",\n        \"sentiment\": \"Positive\"\n    },\n    {\n        \"message\": \"The average compression depth is slightly below the ideal range, suggesting a need for improvement in depth quality.\",\n        \"sentiment\": \"Negative\"\n    },\n    {\n        \"message\": \"There is considerable inconsistency in compression depths as shown by the high standard deviation.\",\n        \"sentiment\": \"Negative\"\n    },\n    {\n        \"message\": \"The overall performance score is moderate, showing room for improvement in CPR skills.\",\n        \"sentiment\": \"Negative\"\n    },\n    {\n        \"message\": \"The frequency of compressions exceeded the ideal range in many cases, indicating potential over-speeding during training.\",\n        \"sentiment\": \"Negative\"\n    }\n]'),
(15,28,'A','[\n    {\n        \"message\": \"The average compression depth is slightly above the minimum ideal range at 51.21 mm, indicating good depth control.\",\n        \"sentiment\": \"Positive\"\n    },\n    {\n        \"message\": \"The mean compression frequency of 114.33 is within the ideal range, suggesting effective frequency management.\",\n        \"sentiment\": \"Positive\"\n    },\n    {\n        \"message\": \"A relatively high standard deviation in depth indicates inconsistency in maintaining the ideal compression depth.\",\n        \"sentiment\": \"Negative\"\n    },\n    {\n        \"message\": \"The training performance score of 78.63 reflects a generally competent execution of CPR technique.\",\n        \"sentiment\": \"Positive\"\n    },\n    {\n        \"message\": \"The high count of low-depth compressions (84) highlights a tendency to sometimes perform compressions shallower than ideal.\",\n        \"sentiment\": \"Negative\"\n    }\n]');
